INSERT INTO `applicant_project_info` VALUES (1,'Career Go','The Careers Go project is similar to a job portal with additional feature of having career guidance as a smaller module at start. The data flowing through the portal will be intended use or uses of the companies who have their profile created with the job openings posted in it and also the applicants who are in search of job opportunities.','Gagan SV,Jack Sparrow','https://www.google.com/','2017-02-01','2017-05-08','',2),(2,'Air Ticket Swapper','As we all know that when the travel date nears, the flight fares tends to increase exponentially or tickets may not be available. At the same time if some passengers want to cancel their tickets and expecting nearly 100% refund, then ATS is the platform where he can sell his ticket to some one who wants to purchase it.','Gaddam Chandra Sekhar, Patel Bhavik, Prueitt Adam, Solur Venkatesh Gagan, Yajman Krupakar Chethan,Vaidyanathan Subramanyan','https://www.google.com/','2017-01-23','2017-05-08','',2),(3,'Recommendation System','Abstract - If I have 3 million customers on the Web, I should have 3 million stores on the Web. -Jeff\r\nBezos, CEO of Amazon.com. To achieve this goal most of the E-commerce sites use recommendation algorithms\r\nto suggest products to online customers and to provide consumers with information to help them decide which\r\nproducts to purchase. The Collaborative Filtering is the most successful algorithm in the recommender systems\'\r\nfield. Till now different approaches and techniques have been proposed. In this project we developed\r\nrecommendation system based on Collaborative filtering and tried to improve performance of Collaborative filtering\r\nby combining it with K-means algorithm to find similar products. We then compare the results based on precisionrecall\r\ncurve.','2','https://www.google.com/','2017-03-01','2017-05-10','',3),(4,'TestFort','TestFort is a large testing company with years of experience in the market and through all that time we have succeeded with a remarkable amount of various projects that differed in complexity, platform, target goals and requirements, etc. We have managed to satisfy strict demands of such sharks as The Huffington Post, Aol., Sega, Skype and Microsoft thus proving precision and accuracy of both our solutions and determining our teams of experts can manage QA, QC and software testing of all types and levels.','4','https://testfort.com/projects','2017-01-01','2017-05-31','',8);
/*!40000 ALTER TABLE `applicant_project_info` ENABLE KEYS */;
UNLOCK TABLES;

