INSERT INTO `applicant_work_details` VALUES (1,'Software Engineer','Google','California','Determines operational feasibility by evaluating analysis, problem definition, requirements, solution development, and proposed solutions.Documents and demonstrates solutions by developing documentation, flowcharts, layouts, diagrams, charts, code comments and clear code.Prepares and installs solutions by determining and designing system specifications, standards, and programming.Improves operations by conducting systems analysis; recommending changes in policies and procedures.Obtains and licenses software by obtaining required information from vendors; recommending purchases; testing and approving products.','2010-08-02','2017-03-31','',2),(2,'QA Analyst','Transfinder','Clifton Park','The QA Analyst will develop test plans, test cases and test scripts for projects, among other assigned duties. The attached document is a typical job description for a Quality Assurance (QA) Analyst.','2017-05-22','2018-12-31','',3);
