INSERT INTO `job_posting_info` VALUES (1,'Software Engineer','Most employers require software engineers to have at least a bachelor\'s degree in software, math or science, as well as broad experience with computers systems and applications. Larger companies, or organizations with unique or proprietary development platforms typically provide training for new employees. ','California, SA','130000$','+1(929)-312-8040','admin@google.com','',1,7,'2017-04-14'),(2,'Software Testing','Most employers require software engineers to have at least a bachelor\'s degree in software, math or science, as well as broad experience with computers systems and applications. Larger companies, or organizations with unique or proprietary development platforms typically provide training for new employees. ','Albany, NY','70000$','+1(518)-700-8990','admin@chub.com','',3,4,'2017-04-15'),(3,'Project Manager','As the project manager, your job is to plan, budget, oversee and document all aspects of the specific project you are working on. Project managers may work closely with upper management to make sure that the scope and direction of each project is on schedule, as well as other departments for support.','Bangalore','70000$','9035245991','admin@wenzins.com','',1,9,'2017-04-16'),(4,'Senior Financial Planner','The primary role of the Sr Financial Planner is to serve as the local financial planning expert and coordinator in their respective market while interfacing with the Financial Planning Center. The Financial Planner will take the lead in the data gathering process, planning construction and delivering team based recommended strategies to the clients. The Financial Planner is also responsible for providing local advocacy for financial planning services as well as implementation expertise. This position collaborates and performs as part of the relationship management team to execute the client strategy.\r\n','Albany NY','100000.0','18005392968','admin@keybank.com','',1,10,'2017-05-09');
